import React,{useState,useEffect} from "react";
import TableTr from "./TableTr";
import Pagination from "react-js-pagination";
import CountingRows from "components/countRows/CountingRows.js"
require("bootstrap-less/bootstrap/bootstrap.less");





const Position = ()=>{
    const products = [
        {trade_id: "1", client: 'Shoes',instrument: 'Running Shoes.',quantity:"asdasd",direction:"asdasd" },
        {trade_id: 1, client: 'Shoes',instrument: 'Running Shoes.',quantity:"asdasd",direction:"asdasd" },
    ];
    const [data,setData] = useState(products)
    const [totalCounPage,setTotalCountPage]=useState()
    const limitCountPage =20;
    let rows;

    useEffect(()=>{
        fetch("/selectTr",{
            method:"GET",
            
        }).then(
            res=>res.json()
        ).then(data=>{
            console.log(data)
            data.end.sort(function(a,b){
                return a.instrument.localeCompare(b.instrument)
            })
            data.end.sort(function(a,b){
                return a.client.localeCompare(b.client)
            })

         
            
            let rows = CountingRows(data)
            setData(rows)
        })
    },[])
    
    return (
    <div>
        <div className="table-div">

            <TableTr data={data}/>
         
        </div>
        <div className="container">
            <ul className="pagination">
                <li><a href="#">1</a></li>
                <li className="active"><a href="#">2</a></li>
                <li><a href="#">3</a></li>
                <li><a href="#">4</a></li>
                <li><a href="#">5</a></li>
            </ul>
        </div>
    </div>
      
    )
}

export default Position
